import React from 'react'
import DefaultLayout from '../components/DefaultLayout'
import { useParams } from 'react-router-dom'

function BookinCar() {
const {carid}=useParams()
  return (
  <DefaultLayout>
    <h1>car id = {carid}</h1>
  </DefaultLayout>
  )
}

export default BookinCar
